import React from 'react';

const Jumbo = (props) => {
    return (
        <div>
            <div className="jumbotron">
                <h1 className="display-3">Clicky Game!</h1>
                <p class="lead">Click on an image to earn points, but don't click on any more than once!</p>

            </div>
        </div>
    );
};

export default Jumbo;
